import React, { useState } from 'react';
import Axios from 'axios';
function ApplicantForm()
{
    const url="http://127.0.0.1:8000/api/apply/";
    const [data,setData]=useState({

        Name:"",
    FName:"Sar",
    Gender:"Male",
    DOB:"2002-04-04",
    Age:"18",
    Category:"ABC",


    Ward:"EKV",
    SubDistrict:"Erode",
    District:"Erode",
    State:"Tamilnadu",

    Pincode:"123456", 

    Mobile:"9087654321",
    AadharNo:"123456789012",
    Disablity:"No",
    DisabilityType:"None",
    BPL_Family_ID:"ded",
    BankDetails:"Nothin",
    IGNOAPS:"Yes",
    IGNWPS:"Yes",
    IGNDPS:"Yes",
    NFBS:"Yes"
    })

    const AddDetails=async()=>{
      await Axios({
            method:'post',
            url:url,
            data:data
         }).then(res=>{
             console.log(res.data);
         });
    }
