            <form onSubmit={(e)=>AddDetails(e)}>
                <input  onChange={(e) => handle(e)} id="Name" value={data.Name} placeholder='Name' type="text"></input>
                <input onChange={(e) => handle(e)} id="Fname" value={data.FName} placeholder='Fname' type='text'></input>
                <input onChange={(e) => handle(e)} id="Gender" value={data.Gender} placeholder='Gender' type='text'></input>
