                <input onChange={(e) => handle(e)} id="Category" value={data.Category} placeholder='Category' type='text'></input>
                <input onChange={(e) => handle(e)} id="Ward" value={data.Ward} placeholder='Ward' type='text'></input>
                <input onChange={(e) => handle(e)} id="SubDistrict" value={data.SubDistrict} placeholder='SubDistrict' type='text'></input>
                <input onChange={(e) => handle(e)} id="District" value={data.District} placeholder='District' type='text'></input>
                <input onChange={(e) => handle(e)} id="State" value={data.State} placeholder='State' type='text'></input>
                <input onChange={(e) => handle(e)} id="Pincode" value={data.Pincode} placeholder='Pincode' type='number'></input>
                <input onChange={(e) => handle(e)} id="Mobile" value={data.Mobile} placeholder='Mobile' type='number'></input>
                <input onChange={(e) => handle(e)} id="AadharNo" value={data.AadharNo} placeholder='AadharNo' type='number'></input>
