                <input onChange={(e) => handle(e)} id="BankDetails" value={data.BankDetails} placeholder='BankDetails' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNOAPS" value={data.IGNOAPS} placeholder='IGNOAPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNWPS" value={data.IGNWPS} placeholder='IGNWPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="IGNDPS" value={data.IGNDPS} placeholder='IGNDPS' type='text'></input>
                <input onChange={(e) => handle(e)} id="NFBS" value={data.NFBS} placeholder='NFBS' type='text'></input>
                <button onClick={AddDetails} >Submit</button>
            </form>


    </div>);

